import ErrorBoundary from './ErrorBoundary'
import PageRouter from './PageRouter'
import ErrorPage from './pages/Error'

function App() {
  return (
    <>
      <ErrorBoundary fallback={<ErrorPage />}>
        <PageRouter />
      </ErrorBoundary>
    </>
  )
}

export default App
